2	Malashree J D	Vice President at Qwikcilver Solutions Pvt. Ltd	Malashree is from Karnataka , native of Davanagere. She is proud alumni of  BIET, 1990-1994 Computer Science& Engineering batch, 4th rank holder of Kuvempu University.\r\nShe is currently serving at Qwikcilver Solutions Pvt. Ltd as Vice President of Technology, Bangalore. Qwikcilver is leading Giftcard solutions platform in India and South East Asia.\r\nHer campus life in her own words " The four years in BIET is most memorable and precious days of my life. College Campus was so beautiful, organized and every department was quite well established back 1990 itself. Very eminent Professors and teaching faculty. Studying here was so different from what we were learning in schools. The emphasis on Applied Science made engineering so attractive with teachers always ready extend their support. We started spending more time in labs from 2nd year itself. College was so open and encouraging for curios students. Department encouraged students to work on projects that are innovative, experimental. Our batch feels lucky to have such knowledgeable and friendly teachers and professors. They set right foundation for our upcoming career."\r\nMalashree started her career with Aditi Technology solutions as software engineer, then worked on first made in India CRM Software Platform Talisma at Talisma Corporation as Lead and Architect. She then moved to Qwikcilver Solutions, took up the Delivery manager role of the electronic Gift Platform .Currently serving as VP in technology. Product development, Startups , Finance and CRM domains Data Science are her core strengths.\r\nShe also active outdoor person, participates in Marathons and Trekking , gardening.	department/alumni/CS/MalashreeJD-Photo_YMkmjTj.jpg	3
3	Mr Nagendra Prasad	Director at American Express	In today' s world, Data is the key and the goal of my current job is to make sure that Data reaches in the form and shape to the Data Scientists who can then get going on their learning and modeling using complex AI and ML. Ingesting petabytes of data in distributed and elastic infrastructure is a true challenge and it' s challenging to do it for multiple enterprises. Successfully running engineering and innovation with teams that are in remote locations is also very key.\r\n\r\nIn the previous stint at Amazon, I worked as a Sr Software Development Manager for building a scalable platform in the Fin-tech space for the spend and expense management, Cost allocation and the ledger bookings as part of liability and payment accruals.\r\n\r\nIn the previous stint worked at Net App as an Engineering Director for one of its big data platform and part of the team that dabbles with bridging the gap between the bleeding edge technologies that are not yet enterprise-ready but has huge potential and making them enterprise-ready also with world-class technology leaders.\r\n\r\nA leader who believes in building long-lasting partnerships laden with Trust Integrity and simplicity and with peers across the spectrum, more importantly, empowering and equipping the team to accomplish the goals and objectives. In Amazon within a span of 6 months, build a team of double digits which is a herculean task as the bar of hiring is very high on Amazon.\r\n\r\nHas been part of a big data and analytics journey at Net App for their telemetry data and was instrumental in leading a team for three generations of data processing platforms.\r\n\r\nA leader who believes in "Not worry about things that you don't have control over on the things that you have control over, hit the ball out of the park".\r\n\r\nMotivator and a leader who can do the walk the talk with a no-nonsense approach to work\r\nWon the prod ops innovation award for leading this team in the Net App product leadership meet in Vegas in Feb 2013. In the past, build teams from scratch and helped them engineer world-class frameworks and products and can keep the team motivated and make sure that they can invent and simplify things with right focus and direction.	department/alumni/CS/Nagendra_Prasad_H8IgPq4.jpeg	2
4	Dr. Shreedhara K S	Principal, UBDTCE , Davanagere	Dr. Shreedhara K S completed his post graduation at NITK,  Surathkal  and Ph.D from Manipal University, Manipal. He is presently working as professor in CSE, University BDT College of Engineering , Davanagere from 1993 to date. He is working/ worked as Chairman DOS in CSE, Co-ordinator(Tabulation),  Dean(Academic),  Placement and Training Officer etc. For his contribution to these works, he receive “Letter of Appreciation”  from Kuvempu University and “Academic Achievement Award”  from UBDT-VTU. \r\nHe is instrumental in starting on-line thesis evaluation software at examination section of VTU and actively involved in various development  activities  of VTU as a Member/ Chairman of various committees for which he received “Letter of Appreciation”  from Registrar (Evaluation) , VTU,  Belagavi . He is presently academic Senate member and BOS Chairman of CS/IS Board of VTU.\r\nTumkur University used his service to execute Campus Wide Networking (CWN) project and other various development activities of the University for which he receivrd  letter “Letter of Appreciation”  from Tumkur University , Tumkur. He developed course materials for the Distance Education Programme of Kuvempu University and he is a co-author  for the textbook entitled “Computer Graphics with Open GL”. He is a Fellow member of IEI, life member of ISTE and CSI. \r\nHe has published more than 30 research articles for various Conferences/ Journals out of which he has received four “Best Research Paper Awards ” and a  fellowship of $2100 from Boston University, Boston, USA. He received a  grant of Rs. 20.00 lakhs from VGST, Department of IT/BT, Government of Karnataka  to establish Research Lab at UBDT College of Engineering, Davanagere  and Rs. 17.00 lakhs from AICTE,  New Delhi for MODROB Projects .\r\nThe chairman , Honorable Secretary and Members of Karnataka State Centre Committee of the Institution of Engineers(INDIA)  are extremely pleased to convey their fraternal felicitations  to Dr. Shreedhara K S  for his  outstanding contribution to the profession and Society and wish him many more years of professional accomplishments which will inspire the younger generation to emulate him and strive for attaining success in their professional career.	department/alumni/CS/Sridhar_K7DH40B.jpeg	1
